import RCompThumbnail from "../../assets/img/compositions/static.png";
import RCompPreview from "../../assets/img/compositions/dynamic.gif";

export const initialState = {
    pageTitle: 'compositions',
    compositions: [
        {
            id: 0,
            title: 'Lespo',
            price: 3.43,
            thumbnail: RCompThumbnail,
            preview: RCompPreview,
            dateCreated: new Date(),
            author: 'Vitaly',
            type: 0,
            background: '',
            badges: [
                {name: 'Popular',},
                {name: 'Free',},
                {name: 'New',},
            ]
        },{
            id: 1,
            title: 'Newzo',
            price: 2.43,
            thumbnail: RCompThumbnail,
            preview: RCompPreview,
            dateCreated: new Date(),
            author: 'Vitaly',
            type: 1,
            background: '',
            badges: [
                {name: 'New',},
                {name: 'Hot',},
            ]
        },{
            id: 2,
            title: 'Winter',
            price: 412.43,
            thumbnail: RCompThumbnail,
            preview: RCompPreview,
            dateCreated: new Date(),
            author: 'Vitaly',
            type: 2,
            background: '',
            badges: [
                {name: 'Free',},
            ]
        },
    ],
}

export function compositionsReducer(state = initialState, action) {
    switch (action.type) {
        case '':
            return {...state,}

        default:
            return state
    }
}
